Fibonacci DP.code:
#include <bits/stdc++.h>
using namespace std;
long long fib(int n){ vector<long long> dp(n+1); dp[0]=0; dp[1]=1;
 for(int i=2;i<=n;i++) dp[i]=dp[i-1]+dp[i-2]; return dp[n]; }
int main(){ cout<<fib(10); }

Longest Increasing Subsequence.code:
#include <bits/stdc++.h>
using namespace std;
int lis(vector<int>& a){ vector<int> v;
 for(int x:a){ auto it=lower_bound(v.begin(),v.end(),x);
 if(it==v.end()) v.push_back(x); else *it=x; }
 return v.size(); }
int main(){ vector<int>a={3,1,2,5}; cout<<lis(a);}
